Memento (1967) Domaci Film

Rezijaimitre Osmanli

Ulogi: Renata Freiskorn,Stevo Zigon,Nada Gesovska,Predrag Ceramilac,Kole Angelovski,Dadi Angelovski,Zlatko Golubovic,Predrag Disljenkovic,Petre Prlicko i dr.

Den pred zemjotresot vo Skopje,Vili Miler germanski dirigent se zapoznava so mladata devojka Jana,studentka od Skopje.Posle nekolku godini se srekavaat povtorno na &quot;Sredbite na solidarnost&quot; vo Skopje, kade Vili go predvodi koncertot odrzan vo taa prigoda.Tie nekolku dena pominati so dirigentot , za Jana znacat vrakanje na spomenite od nejzinata semejna tragedija so zemjotresot , no i prilika za nov pocetok. Iako postoi moznost za zaminuvanje so Miler,sepak taa ke ostane vo Skopje pokraj momceto koe go saka...

